import React from "react";
import Tasks from "./Tasks";
const Projects = ({
  projects,
  tasks,
  onDelete,
  onToggle,
  onShow,
  onComplete,
}) => {
  return (
    <div>
      {projects.map((project) => (
        <Tasks
          key={project.id}
          tasks={tasks}
          onDelete={onDelete}
          onToggle={onToggle}
          onShow={onShow}
          showShort={project.show}
          onComplete={onComplete}
          type={project.text}
        ></Tasks>
      ))}
    </div>
  );
};

export default Projects;
